import React from 'react';
import { render } from 'react-dom';
import { Layout ,  Row, Col, Breadcrumb , Select,Form, Transfer, Switch } from 'antd';
import 'antd/dist/antd.css';
import './index.css';

const { Header, Footer, Sider, Content } = Layout;
const { Option } = Select;
const layout = {
  labelCol: {
    span: 8,
  },
  wrapperCol: {
    span: 16,
  },
};

const mockData = [];
for (let i = 0; i < 20; i++) {
  mockData.push({
    key: i.toString(),
    title: `content${i + 1}`,
    description: `description of content${i + 1}`,
    disabled: i % 3 < 1,
  });
}

const oriTargetKeys = mockData.filter(item => +item.key % 3 > 1).map(item => item.key);

function onChange(value) {
  console.log(`selected ${value}`);
}

function onBlur() {
  console.log('blur');
}

function onFocus() {
  console.log('focus');
}

function onSearch(val) {
  console.log('search:', val);
}


class App extends React.Component {
  state = {
    targetKeys: oriTargetKeys,
    selectedKeys: [],
  };

render() {
  const { targetKeys, selectedKeys, disabled } = this.state;

  return (
    <Layout>
    <Header>Header</Header>
    <Layout>
      <Sider>Sider</Sider>
      <Content>
      <Row style={{ padding: '0 24px 24px', backgroundColor: '#ffffff'}}>
      <Col span={24}><h1>ส่งออกข้อมูล</h1></Col>
      </Row>
      <Row style={{ margin: '24px 24px 24px 24px', backgroundColor: '#ffffff'}}>
          <Col span={24}>
          <Breadcrumb style={{ backgroundColor: '#ffffff'}}>
            <Breadcrumb.Item>หน้าหลัก</Breadcrumb.Item>
            <Breadcrumb.Item>ผู้ดูแลระบบ</Breadcrumb.Item>
            <Breadcrumb.Item>ส่งออกข้อมูล</Breadcrumb.Item>
          </Breadcrumb>
          </Col>
          <Col span={24}>
          <Form {...layout}  name="control-hooks" >
          <Form.Item
            name="employeeType"
            label="ประเภท"
            rules={[
              {
                required: true,
              },
            ]}
          >
          <Select
            showSearch
            style={{ width: 300 }}
            placeholder="การศึกษาพนักงาน"
            optionFilterProp="children"
            onChange={onChange}
            onFocus={onFocus}
            onBlur={onBlur}
            onSearch={onSearch}
            filterOption={(input, option) =>
              option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
            }
          >
            <Option value="1">E-Learning Upload Template (Report)</Option>
          </Select>
          </Form.Item>
          <Form.Item
            name="exportField"
            label="เลือกข้อมูลที่ต้องการ :"
            rules={[
              {
                required: true,
              },
            ]}
          >
          <div>
        <Transfer
          dataSource={mockData}
          titles={['Source', 'Target']}
          targetKeys={targetKeys}
          selectedKeys={selectedKeys}
          onChange={this.handleChange}
          onSelectChange={this.handleSelectChange}
          onScroll={this.handleScroll}
          render={item => item.title}
        />
      </div>
      </Form.Item>

          </Form>
          </Col>
      </Row>
      </Content>
    </Layout>
    <Footer>Footer</Footer>
    </Layout>
  );
 }
};

render(<App />, document.getElementById('root'));
